create table data_school
(
    id           int          not null
        primary key,
    name         varchar(64)  null comment '学校名称',
    province_id  int          null comment '省份ID',
    level        varchar(64)  null comment '学校级别',
    website      varchar(255) null comment '学校网址',
    abbreviation varchar(64)  null comment '学校简称'
)
    comment '高校数据表' charset = utf8mb4;

create index province_id
    on data_school (province_id);

